var t = ''

for (var k in emoji) {
  var v = emoji[k]
  t += `<span class=svg-container data-k=${k}> ${v} </span>`;
}
var template = `<div class='emoji'> ${t} <div>`
$('#id-input-content').after(template)
// document.body.innerHTML = t
$('.emoji').on('click', '.svg-container', function() {
  var content =$('#id-input-content').val()
  content += $(this).data('k')
  $('#id-input-content').val(content)
});

function filterEmoji(s) {
  for (var k in emoji) {
    s = replaceAll(s, k, emoji[k])
  }
  return s;
}

function replaceAll(s, a, b) {
  if (s.indexOf(a) == -1) {
    return s;
  }
  s = s.replace(a, b)
  return replaceAll(s, a, b)
}
